function drawMap(){function t(t){var n=t.replace(/\s/g,"").toLowerCase();return n}drawMap.prototype.draw=function(n,e,r){d3.csv(e,function(e){var a=d3.nest().entries(e);d3.select("#"+n).selectAll("#"+n+" li").data(a).enter().append("li").attr("id",function(t){return t.abb}).attr("class",function(n){return t(n[r])}).attr("data-state",function(t){return t.abb}).text(function(t){return t.letter})})}}
